	<p>Note: Importing a theme will replace your existing custom set colors.</p>
<?php
if(isset($_GET['status']) && $_GET['status'] == 'updated')
	echo '<div id="message" class="updated below-h2"><p>Theme Imported!</p></div>';
?>
	<form name="wps_set_theme" method="post" action="">
		<table class="form-table">
			<tbody><tr>
<?php
	$selected_theme = (isset($_POST['wps_color_theme'])) ? trim($_POST['wps_color_theme']) : "";
	$x = 0;
	foreach ($wps_themes as $wps_theme_name => $wps_theme) {
