				<tbody><tr>
					<td style="background-color: <?php echo $wps_theme_data['admin_bar_color']; ?>">&nbsp;</td>
					<td style="background-color: <?php echo $wps_theme_data['nav_wrap_color']; ?>">&nbsp;</td>
					<td style="background-color: <?php echo $wps_theme_data['active_menu_color']; ?>">&nbsp;</td>
					<td style="background-color: <?php echo $wps_theme_data['pry_button_color']; ?>">&nbsp;</td>
