</div>
<?php		
	}
	
	function import_theme() 
	{
		if(isset($_POST['wps_import_theme_field']) ) {
			if(!wp_verify_nonce( $_POST['wps_import_theme_field'], 'wps_import_theme_nonce' ) )
				exit();
			$wps_themes = $this->get_wps_themes();
			$selected_theme = trim($_POST['wps_color_theme']);
			$get_wps_options_default = $this->get_wps_option_data('wpshapere_options');
			$get_wps_options_color = unserialize(base64_decode($wps_themes[$selected_theme]));
			$wps_color_theme_data = array_merge($get_wps_options_default, $get_wps_options_color);
			$wps_color_theme_data = serialize($wps_color_theme_data);
			
			if($this->is_wps_single()) {
				update_option($this->wps_options, $wps_color_theme_data);
			}
			else {
				update_site_option($this->wps_options, $wps_color_theme_data);
			}
			wp_safe_redirect( admin_url( 'admin.php?page=wps_themes&status=updated' ) );
			exit();
		}
	}
	
	function get_wps_themes() 
	{
	
		$wps_themes = array();
		$wps_themes['Default'] = '';			
		$wps_themes['sleek'] = '';
		$wps_themes['slate'] = '';	
		$wps_themes['Pomegranate'] = '';
		$wps_themes['Hot pink'] = '';
		$wps_themes['Hive'] = '';
		$wps_themes['Grass'] = '';
		$wps_themes['Blueberry'] = '';
		$wps_themes['Blossoms'] = '';
		$wps_themes['Black and white'] = '';
		$wps_themes['Beach'] = '';
		$wps_themes['Africa'] = '';
		$wps_themes['Mint'] = '';
		$wps_themes['Paper and clay'] = '';
		$wps_themes['Sailor'] = '';
		$wps_themes['Vitamin'] = '';
			
		return $wps_themes;
	}
	
}

$wpshaperethemes = new WPSTHEMES();